function Passwordbox() {
  return (
    <div className={styles.passwordbox}>
        Password: <br/>
        <input type={'password'} name='password1'></input>
        Confirm Password: <br/>
        <input type={'password'} name='password2'></input>
    </div>
  );
}

export default Passwordbox;
